        <script>
            document.addEventListener('DOMContentLoaded', () => {
                if (window.innerWidth > 767) {
                    let isScrolling = false; // Flag to track if scrolling animation is in progress
                    const scrollSnapWrap = document.querySelector('.scroll-snap_wrap');
                    if (!scrollSnapWrap) {
                        console.error("No element found with class 'scroll-snap_wrap'");
                        return; // Exit the function if no scroll-snap_wrap element is found
                    }
                    const sections = scrollSnapWrap.querySelectorAll('*[id*="section"]');
                    let currentIndex = findClosestIndex(); // Calculate closest index on load

                    const calculateIndex = (targetId) => {
                        for (let i = 0; i < sections.length; i++) {
                            if (sections[i].id === targetId) {
                                return i;
                            }
                        }
                        return currentIndex; // If targetId is not found, return current index
                    };

                    const progressLinks = document.querySelectorAll('.progress_link, .nav_link, .footer_link');
                    progressLinks.forEach(link => {
                        link.addEventListener('click', (e) => {
                            e.preventDefault();
                            const targetId = link.getAttribute('href').slice(1);
                            const newIndex = calculateIndex(targetId);
                            if (newIndex !== currentIndex) {
                                currentIndex = newIndex;
                                scrollToIndex(newIndex);
                            }
                        });
                    });

                    const scrollToIndex = (index) => {
                        if (isScrolling) return;
                        isScrolling = true;
                        const targetOffset = sections[index].closest('.sticky_wrap') ?
                            sections[index].closest('.sticky_wrap').offsetTop + sections[index].offsetTop :
                            sections[index].offsetTop;
                        gsap.to(window, {
                            scrollTo: {
                                y: targetOffset
                            },
                            duration: 1,
                            ease: CustomEase.create("custom", "M0,0 C0.532,0 0.798,0.972 1,1 "),
                            onComplete: () => {
                                isScrolling = false;
                                currentIndex = index;
                            }
                        });
                    };

                    function findClosestIndex() {
                        const scrollPosition = window.pageYOffset || document.documentElement.scrollTop;
                        let closestIndex = 0;
                        let smallestDistance = Infinity;
                        sections.forEach((section, index) => {
                            const distance = Math.abs(section.offsetTop - scrollPosition);
                            if (distance < smallestDistance) {
                                smallestDistance = distance;
                                closestIndex = index;
                            }
                        });
                        return closestIndex;
                    }

                    document.addEventListener('wheel', (e) => {
                        e.preventDefault();
                        if (isScrolling) return;
                        const direction = e.deltaY > 0 ? 1 : -1;
                        const newIndex = currentIndex + direction;
                        if (newIndex >= 0 && newIndex < sections.length) {
                            scrollToIndex(newIndex);
                        }
                    }, {
                        passive: false
                    });

                    let touchStartY = 0;
                    let touchEndY = 0;
                    document.addEventListener('touchstart', (e) => {
                        touchStartY = e.changedTouches[0].clientY;
                    }, {
                        passive: true
                    });

                    document.addEventListener('touchend', (e) => {
                        touchEndY = e.changedTouches[0].clientY;
                        const direction = touchStartY > touchEndY ? 1 : -1;
                        if (isScrolling) return;
                        const newIndex = currentIndex + direction;
                        if (newIndex >= 0 && newIndex < sections.length) {
                            scrollToIndex(newIndex);
                        }
                    }, {
                        passive: true
                    });

                    document.addEventListener('keydown', (e) => {
                        if (e.key === 'ArrowUp' || e.key === 'ArrowDown') {
                            e.preventDefault();
                            const direction = e.key === 'ArrowDown' ? 1 : -1;
                            if (isScrolling) return;
                            const newIndex = currentIndex + direction;
                            if (newIndex >= 0 && newIndex < sections.length) {
                                scrollToIndex(newIndex);
                            }
                        }
                    });
                }
            });
        </script>





        <script>
            // Variables
            const scramble = document.querySelectorAll(".scramble");
            const bigType = document.querySelectorAll(".big-type");
            const smallType = document.querySelectorAll(".small-type");

            // Create a single GSAP timeline called introScramble
            const introScramble = gsap.timeline({
                paused: true
            });

            // GSAP Scramble Effect and Big Type Animation
            introScramble
                .to(scramble, {
                    duration: 3,
                    stagger: 0.2,
                    scrambleText: {
                        speed: 0.5,
                        text: "{original}",
                        chars: "+?84564XERSHKZN"
                    }
                }, 0) // Start at time 0
                .from(bigType, {
                    stagger: 0.2, // Match the stagger with scramble effect
                    opacity: 0,
                    y: 80,
                    ease: "power2.inOut",
                    duration: 1.25,
                    filter: "blur(20px)"
                }, 0) // Start at time 0

                // Small Type Animation
                .from(smallType, {
                    stagger: 0.25,
                    y: 10,
                    opacity: 0,
                    ease: "power2.inOut",
                    duration: 0.75
                }, 0.4); // Start 0.2 seconds after the others

            // Function to play the introScramble timeline
            function playIntroScramble() {
                introScramble.play();
            }

            // Add event listener to trigger the animation
            document.addEventListener('DOMContentLoaded', playIntroScramble);
        </script>






        <script>
            // Variables
            const links = document.querySelectorAll(".progress_link");
            const connectButtons = document.querySelectorAll(".button.is-nav-connect");

            // Store original text content of each link
            const originalTexts = Array.from(links).map(link => link.innerText);

            // Function to handle hover animation for progress links
            function handleHover(e) {
                const target = e.target;
                const isCurrent = target.classList.contains("w--current");
                const dataText = target.dataset.text;

                if (!isCurrent) {
                    gsap.to(target, {
                        duration: 0.5,
                        scrambleText: {
                            text: dataText,
                            chars: "123456789"
                        }
                    });
                }
            }

            // Function to handle hover out animation for progress links
            function handleHoverOut(e) {
                const target = e.target;
                const isCurrent = target.classList.contains("w--current");
                const index = Array.from(links).indexOf(target);
                const originalText = originalTexts[index];

                if (!isCurrent) {
                    gsap.to(target, {
                        duration: 0.5,
                        scrambleText: {
                            text: originalText,
                            chars: "123456789",
                            speed: 0.5,
                            ease: "power2.inOut"
                        }
                    });
                }
            }

            // Function to handle hover animation for connect buttons
            function handleConnectHover(e) {
                gsap.to(e.target, {
                    duration: 0.9,
                    scrambleText: {
                        text: "CONNECT NOW",
                        chars: "123456789"
                    }
                });
            }

            // Function to handle hover out animation for connect buttons
            function handleConnectHoverOut(e) {
                gsap.to(e.target, {
                    duration: 0.5,
                    scrambleText: {
                        text: "68656C6C6F20776F726C64",
                        chars: "123456789"
                    }
                });
            }

            // Function to handle w--current class change
            function handleCurrentChange(mutationsList) {
                mutationsList.forEach(mutation => {
                    const target = mutation.target;
                    const index = Array.from(links).indexOf(target);
                    const isCurrent = target.classList.contains("w--current");
                    const dataText = target.dataset.text;
                    const originalText = originalTexts[index];

                    if (isCurrent && mutation.type === "attributes") {
                        gsap.to(target, {
                            duration: 0.5,
                            scrambleText: {
                                text: dataText,
                                chars: "123456789"
                            }
                        });
                    } else if (!isCurrent && mutation.type === "attributes") {
                        gsap.to(target, {
                            duration: 0.5,
                            scrambleText: {
                                text: originalText,
                                chars: "123456789",
                                speed: 0.5,
                                ease: "power2.inOut"
                            }
                        });
                    }
                });
            }

            // Event listeners for hover on links and connect buttons
            links.forEach(link => {
                link.addEventListener("mouseenter", handleHover);
                link.addEventListener("mouseleave", handleHoverOut);
            });

            connectButtons.forEach(button => {
                button.addEventListener("mouseenter", handleConnectHover);
                button.addEventListener("mouseleave", handleConnectHoverOut);
            });

            // Observer to detect changes in w--current class
            const observer = new MutationObserver(handleCurrentChange);
            links.forEach(link => {
                observer.observe(link, {
                    attributes: true,
                    attributeFilter: ["class"]
                });
            });
        </script>

        <script>
            // Function to scramble the text of an element
            function scrambleText(element) {
                const targetText = element.textContent.trim();
                const scrambleChars = "123456789";
                const delay = element.dataset.scrollDelay ? parseFloat(element.dataset.scrollDelay) : 0; // Retrieve delay from data-scroll-delay attribute

                // Create a GSAP timeline for the scramble effect with the initial delay
                const scrambleTL = gsap.timeline({
                    paused: true,
                    delay: delay
                });

                // Extend the duration of each animation step
                scrambleTL.to(element, {
                        duration: 2,
                        text: scrambleChars,
                        scrambleText: {
                            chars: scrambleChars
                        }
                    }) // Duration of scrambling effect
                    .to(element, {
                        duration: 2,
                        text: targetText,
                        ease: "power2.inOut"
                    }); // Duration of revealing text effect

                // Play the scramble animation on scroll
                const observer = new IntersectionObserver(entries => {
                    entries.forEach(entry => {
                        if (entry.isIntersecting) {
                            scrambleTL.play(0); // Reset and play from start including the initial delay
                        } else {
                            scrambleTL.reverse();
                        }
                    });
                }, {
                    threshold: 0.5
                }); // Trigger animation when 50% of the element is visible

                observer.observe(element);

                // Optionally play the animation on page load for in-view elements
                if (element.isIntersecting) {
                    scrambleTL.play(0);
                }
            }

            // Get all elements with data-text-scroll attribute
            const scrambleElements = document.querySelectorAll(".sub-header");

            // Apply scramble effect to each element
            scrambleElements.forEach(element => {
                scrambleText(element);
            });
        </script>



