        <script>
            $(document).ready(function() {
                // Function to check which section is at the top of the page
                function checkActiveSection() {
                    var scrollPosition = $(window).scrollTop(); // Current scroll position
                    var dotOffset = 10; // Adjust this value as needed

                    $(".section").each(function() {
                        var sectionTop = $(this).offset().top; // Top position of the section
                        var sectionId = $(this).attr("id");

                        // Calculate the distance from the top of the window to the top of the section
                        var distanceToTop = sectionTop - scrollPosition;

                        // Activate the corresponding link if the section is within the viewport
                        if (distanceToTop <= dotOffset) {
                            // Activate the corresponding link
                            $(".nav-link").removeClass("is-active");
                            $("#link-" + sectionId.slice(-1)).addClass("is-active");
                        }
                    });
                }

                // Check active section on page load
                checkActiveSection();

                // Check active section on scroll
                $(window).scroll(function() {
                    checkActiveSection();
                });
            });
        </script>

        <script>
            //form code 
            document.addEventListener("DOMContentLoaded", function() {
                const formFields = document.querySelectorAll('.form_field');
                const submitButton = document.querySelector('.button.is-form-submit');

                function updateLabelOpacity(field, state) {
                    const label = field.previousElementSibling;
                    if (label && label.classList.contains('field_label')) {
                        label.style.opacity = state ? '1' : '0';
                    }
                }

                function checkFormCompletion() {
                    let allFilled = true;
                    formFields.forEach(field => {
                        if (field.value === '') {
                            allFilled = false;
                        }
                    });
                    submitButton.style.opacity = allFilled ? '1' : '0';
                }

                formFields.forEach(field => {
                    // Update label opacity on focus
                    field.addEventListener('focus', () => {
                        updateLabelOpacity(field, true);
                    });

                    // Update label opacity when input has text
                    field.addEventListener('input', () => {
                        checkFormCompletion();
                        if (field.value !== '') {
                            updateLabelOpacity(field, true);
                        } else {
                            updateLabelOpacity(field, false);
                        }
                    });

                    // Optional: revert opacity if field loses focus and is empty
                    field.addEventListener('blur', () => {
                        if (field.value === '') {
                            updateLabelOpacity(field, false);
                        }
                    });
                });

                // Check form completion on page load
                checkFormCompletion();
            });
        </script>

        <script>
            document.addEventListener('DOMContentLoaded', function() {
                const fadeOut = document.querySelector('.anchor-fade');

                function fadeEffect(time, callback) {
                    // Show the element before starting the animation
                    fadeOut.style.display = 'block';

                    gsap.to(fadeOut, {
                        opacity: 1,
                        duration: 0.3,
                        ease: 'power2.out'
                    }).then(() => {
                        // Execute the callback function (scrolling) after the fade-in
                        if (callback) callback();

                        gsap.to(fadeOut, {
                            opacity: 0,
                            duration: 0.3,
                            delay: time,
                            ease: 'power2.out',
                            onComplete: () => {
                                // Hide the element after the animation is complete
                                fadeOut.style.display = 'none';
                            }
                        });
                    });
                }

                function scrollToAnchor(targetId) {
                    const targetElement = document.querySelector(targetId);

                    if (targetElement) {
                        targetElement.scrollIntoView({
                            behavior: 'auto', // Instant scroll
                            block: 'start'
                        });

                        // For Webflow compatibility
                        targetElement.dispatchEvent(new CustomEvent('scrollTimeUpdated', {
                            detail: {
                                scrollTime: 300
                            }
                        }));

                        // Simulate click on the parent element
                        const parentElement = targetElement.parentElement;
                        if (parentElement) {
                            parentElement.click();
                        }
                    }
                }

                // Select all anchor elements with the classes .progress_link, .nav_link, and .footer_link
                const anchorElements = document.querySelectorAll('.progress_link, .nav_link, .footer_link');

                anchorElements.forEach((element) => {
                    element.addEventListener('click', (e) => {
                        // Skip fade and scroll for "Careers" and "Legal" links
                        if (linkText === "Careers" || linkText === "Legal") {
                            return; // Allow default behavior
                        }

                        // Prevent the default anchor click behavior
                        e.preventDefault();

                        // Get the target ID from the href attribute
                        const targetId = element.getAttribute('href');

                        // Trigger the fade effect with a callback to scroll after a delay
                        const time = 0.3;

                        fadeEffect(time, () => {
                            setTimeout(() => {
                                // Scroll to the anchor after a delay
                                scrollToAnchor(targetId);
                            }, 300); // 0.3 seconds delay before scrolling
                        });
                    });
                });

                // Handle URL hash change
                window.addEventListener('hashchange', function() {
                    const targetId = window.location.hash;
                    fadeEffect(0.3, () => {
                        setTimeout(() => {
                            scrollToAnchor(targetId);
                        }, 300); // 0.3 seconds delay before scrolling
                    });
                });

                // Handle initial load with hash
                if (window.location.hash) {
                    const targetId = window.location.hash;
                    fadeEffect(0.3, () => {
                        setTimeout(() => {
                            scrollToAnchor(targetId);
                        }, 300); // 0.3 seconds delay before scrolling
                    });
                }
            });
        </script>
